import React, { Component } from "react";
import NavbarComponen from "./NavbarComponen";
import Table from "./Table";

export default class index extends Component {
  render() {
    return (
      <div>
        <NavbarComponen />
        <div className="container mt-4">
          <h2>Ini React js</h2>
          <Table />
        </div>
      </div>
    );
  }
}
